import React from 'react';
import './About.css'

function About() {
    return (
        <div className="about_container">
            <span>
                "Freedom is the freedom to say that two plus two make four. If
                that is granted, all else follows."
            </span>
            <span>-George Orwell, 1984</span>
        </div>
    );
}

export default About;
